import { Link } from "react-router-dom";

function Home(){
    return(
        <div>
            <div className="conatainer mt-5 bt-5 d-flex justify-content-between align-item-center">
                <div className="add_videos">
                    <Link to="/upload" className="btn btn-primary">Add Videos</Link>
                </div>
            </div>
            <Link to={'/watch'} style={{fontFamily:"-moz-initial",fontSize:"30px",textDecoration:"none",color:"white"}}> Watch History</Link>

            

        </div>
    )
}
export default Home;
